using FlatUI;
using Ps;
using System;
using System.Drawing;
using System.IO;
using System.Windows.Forms;
using Typesetterer.Data;

namespace Typesetterer
{
    internal class EntryPointPhase : Phase
    {
        private static ByteImage PlayImage;

        private static ByteImage ResumeImage;

        private static ByteImage ToolsImage;

        static EntryPointPhase()
        {
            EntryPointPhase.PlayImage = new ByteImage("65:");
            EntryPointPhase.ResumeImage = new ByteImage("78:");
            EntryPointPhase.ToolsImage = new ByteImage("79:");
        }

        public EntryPointPhase(FlatForm parent) : base(parent)
        {
            base.Sizable = true;
            base.AccentColor = Color.FromArgb(27, 27, 28);
            FlatInfoButton flatInfoButton = new FlatInfoButton()
            {
                Text = "Start a new release",
                Description = "Load your script and add the images they go with. Then get to actually typesetting!",
                DescriptionFont = Theme.RegularItemFont,
                DescriptionColor = Theme.DarkForeground,
                Font = Theme.RegularBigItemFont,
                ForeColor = Theme.DarkForeground,
                AccentColor = Theme.Fuscia,
                Link = false,
                Anchor = AnchorStyles.None,
                Padding = new Padding(10),
                Width = 280,
                Height = 110,
                BackgroundIcon = EntryPointPhase.PlayImage
            };
            flatInfoButton.RoughClick += new EventHandler((object s, EventArgs e) => this.OnPhaseChanged(new PhaseChangedEventArgs()
            {
                NewPhase = EntryForm.Phase.Wizard
            }));
            FlatInfoButton flatInfoButton1 = new FlatInfoButton()
            {
                Text = "Continue from unfinished release",
                Description = "Pick up from where you left off on an already set-up release.",
                DescriptionFont = Theme.RegularItemFont,
                DescriptionColor = Theme.DarkForeground,
                Font = Theme.RegularBigItemFont,
                ForeColor = Theme.DarkForeground,
                AccentColor = Theme.Blue,
                Link = false,
                Anchor = AnchorStyles.None,
                Padding = new Padding(10),
                Width = 280,
                Height = 100,
                Enabled = false,
                BackgroundIcon = EntryPointPhase.ResumeImage
            };
            flatInfoButton1.Enabled = (!Directory.Exists(State.UnfinishedPath) ? false : Directory.GetFiles(State.UnfinishedPath).Length != 0);
            flatInfoButton1.RoughClick += new EventHandler((object s, EventArgs e) =>
            {
                EventHandler eventHandler = this.ResumeClicked;
                if (eventHandler == null)
                {
                    return;
                }
                eventHandler(this, null);
            });
            FlatInfoButton flatInfoButton2 = new FlatInfoButton()
            {
                Text = "Launch the overlay",
                Font = Theme.RegularBigItemFont,
                Description = "Use the overlay to easily swap text styles, size fonts, toggle cleaning layers, center bubbles, and finalize a release!",
                DescriptionFont = Theme.RegularItemFont,
                DescriptionColor = Theme.DarkForeground,
                ForeColor = Theme.DarkForeground,
                AccentColor = Theme.Blue,
                Link = false,
                Anchor = AnchorStyles.None,
                Padding = new Padding(10),
                Width = 280,
                Height = 110,
                Margin = new Padding(20),
                BackgroundIcon = EntryPointPhase.ToolsImage
            };
            flatInfoButton2.RoughClick += new EventHandler((object s, EventArgs e) => this.OnPhaseChanged(new PhaseChangedEventArgs()
            {
                NewPhase = EntryForm.Phase.Overlay
            }));
            if (Photoshop.Versions.Count > 0)
            {
                base.MinimumSize = new System.Drawing.Size(400, 530);
                base.Panel = new TLayout(new object[] { new Label()
                {
                    Font = Theme.RegularItemFont,
                    Text = "Thanks for using Typesetterer! This program is meant to make typesetting multiple images quicker and easier. All you need to get started are the images and the text.",
                    AutoSize = false,
                    MinimumSize = new System.Drawing.Size(350, 60)
                }, 20, flatInfoButton, 20, flatInfoButton1, 20, flatInfoButton2 })
                {
                    Direction = Orientation.Vertical,
                    Horizontal = Method.Justified,
                    Padding = new Padding(15)
                };
                return;
            }
            base.MinimumSize = new System.Drawing.Size(400, 220);
            base.Panel = new TLayout(new object[] { new Label()
            {
                Font = Theme.RegularItemFont,
                Text = "Thanks for using Typesetterer! This program is meant to make typesetting multiple images quicker and easier. All you need to get started are the images and the text --",
                AutoSize = false,
                MinimumSize = new System.Drawing.Size(350, 70)
            }, new Label()
            {
                Font = Theme.BoldItemFont,
                Text = "and Photoshop, which you don't appear to have!",
                ForeColor = Theme.Red,
                AutoSize = false,
                MinimumSize = new System.Drawing.Size(350, 30)
            }, new Label()
            {
                Font = Theme.RegularItemFont,
                Text = "Install it -- Photoshop CS2 or newer -- and re-open this app to get started!",
                AutoSize = false,
                MinimumSize = new System.Drawing.Size(350, 60)
            } })
            {
                Direction = Orientation.Vertical,
                Horizontal = Method.Justified,
                Padding = new Padding(15)
            };
        }

        public event EventHandler ResumeClicked;
    }
}